import express , { json } from 'express'


/** Obtener todos los comercios */
export async function getAll(req,res){

 try {
         





        let mensajes = await Mensaje.findAll();
        
        if(mensajes){

          res.json(mensajes);
            //res.json(['John', 'Betty', 'Hal']);
        }
        else{
            res.status(500).json({
                message:'No se encontro mensajes.'      
            })
        }
       
       
  
      } catch (error) {
          res.status(500).json({
              message:'algo salio mal obteniendo los mensajes',
              data:{error}
          });
      } 
}

