import Sequelize from 'sequelize';
import {sequelize} from '../database/database';

const Mensaje = sequelize.define('mensajes', {
  
    men_id:{
       type: Sequelize.UUID,
       defaultValue: Sequelize.UUIDV4,
       primaryKey: true
    },

    men_user_idSent:
    {
      type: Sequelize.INTEGER
    },

    men_user_idRec:
    {
      type: Sequelize.INTEGER
    },


    men_texto:{
        type: Sequelize.TEXT
    }
    

  
    
});
module.exports = Mensaje;

